Question: Find tan X
Choices:
(A) \frac { 5 } { 12 }
(B) \frac { 12 } { 13 }
(C) \frac { 17 } { 12 }
(D) \frac { 12 } { 5 }

generated_answers:
Let the right triangle be denoted with vertices A, B, and C, where the right angle is at B. Let the angle at vertex A be X.
From the image, we can identify the following sides with respect to angle X:
Opposite side (to angle X) = 5
Hypotenuse = 13

We need to find tan X. The definition of the tangent function in a right triangle is:
tan X = \frac{\text{Length of the opposite side}}{\text{Length of the adjacent side}}

We know the length of the opposite side is 5. To find the length of the adjacent side, we can use the Pythagorean theorem, which states that in a right triangle, the square of the length of the hypotenuse (c) is equal to the sum of the squares of the lengths of the other two sides (a and b):
a^2 + b^2 = c^2

In our case, let the adjacent side be 'a', the opposite side be 'b', and the hypotenuse be 'c'. We have:
a^2 + 5^2 = 13^2
a^2 + 25 = 169
a^2 = 169 - 25
a^2 = 144
a = \sqrt{144}
a = 12

So, the length of the adjacent side is 12.

Now we can calculate tan X:
tan X = \frac{\text{Opposite side}}{\text{Adjacent side}}
tan X = \frac{5}{12}

Comparing this result with the given choices:
(A) \frac { 5 } { 12 }
(B) \frac { 12 } { 13 }
(C) \frac { 17 } { 12 }
(D) \frac { 12 } { 5 }

The correct option is (A).

Final Answer: The final answer is $\boxed{A}$
